    \begin {tikzcd}
      x\ar [r, "l"]\ar [d, "l"'] & z\ar [d, "r"] \\
      z'\ar [r, "r"'] & y\makebox [0pt][l]{,}
    \end {tikzcd}


 but that the composite z\to  z'\to  z also solves this problem. Thus this
  composite is the identity, and the same works in the other direction.
  Moreover, since the orthgonal classes always contain the isomorphisms and are
  closed under composition, (L, R) forms a factorization system.

A (strong, compare to weak) factorization system in a category C consists of
two classes of maps L and R so that:

every map admits an (L, R)-factorization;

this factorization is unique up to unique isomorphism;

L and R are closed under composition and contain the isomorphisms.

A weak factorization system in a category C consists of two classes of maps L and R so that:
every map admits an (L, R)-factorization;
L is the weakly left orthgonal class {}^\rightthreetimes R and similarly R is L^\rightthreetimes .

